INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(6, 'Cocktail Investing', 'Christopher J. Versace ', 'English', 'Non Fiction', 'Business and Leadership', '', 'Wiley', '', 100, , 'Distilling Everyday Noise into Clear Investment Signals for Better Returns', 0, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(8, 'The Art of Work', 'Jeff Goins', 'English', 'Non Fiction', 'Business and Leadership', '', 'Wiley', '', 100, NULL, ' A Proven Path to Discovering What You Were Meant to Do', 0, '2020-02-16 06:54:53', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(9, 'Company of One', 'Paul Jarvis', 'English', 'Non Fiction', 'Business and Leadership', '', 'Houghton Mifflin Harcourt', '1328972356', 272, , 'Company of One is a refreshingly new approach centered on staying small and avoiding growth, for any size business. Not as a freelancer who only gets paid on a per piece basis, and not as an entrepreneurial start-up that wants to scale as soon as possible, but as a small business that is deliberately committed to staying that way. By staying small, one can have freedom to pursue more meaningful pleasures in life, and avoid the headaches that result from dealing with employees, long meetings, or worrying about expansion. Company of One introduces this unique business strategy and explains how to make it work for you, including how to generate cash flow on an ongoing basis.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(10, 'The Infinite Game', 'Simon Sinek', 'English', 'Non Fiction', 'Business and Leadership', '', 'Portfolio', '073521350X', 272, , 'How do we win a game that has no end? Finite games, like football or chess, have known players, fixed rules and a clear endpoint. The winners and losers are easily identified. Infinite games, games with no finish line, like business or politics, or life itself, have players who come and go. The rules of an infinite game are changeable while infinite games have no defined endpoint. There are no winners or losersonly ahead and behind.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(11, 'Loonshots', 'Safi Bahcall', 'English', 'Non Fiction', 'Business and Leadership', '', 'St. Martin\'s Press', '1250185963', 368, , 'Loonshots reveals a surprising new way of thinking about the mysteries of group behavior that challenges everything we thought we knew about nurturing radical breakthroughs.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(12, 'Nine Lies About Work', 'Marcus Buckingham', 'English', 'Non Fiction', 'Business and Leadership', '', 'Harvard Business Review Press', '1633696308', 256, , 'This is the real world of work, as it is and as it should be. Nine Lies About Work reveals the few core truths that will help you show just how good you are to those who truly rely on you.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(13, 'Stillness Is the Key', 'Ryan Holiday', 'English', 'Non Fiction', 'Business and Leadership', '', 'Portfolio', '0525538585', 288, , 'More than ever, people are overwhelmed. They face obstacles and egos and competition. Stillness Is the Key offers a simple but inspiring antidote to the stress of 24/7 news and social media. The stillness that we all seek is the path to meaning, contentment, and excellence in a world that needs more of it than ever.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(14, 'The Obstacle Is the Way', 'Ryan Holiday', 'English', 'Non Fiction', 'Self-Help', '', 'Tim Ferriss', '0525538585', 288, , 'We are stuck, stymied, frustrated. But it needn\'t be this way. There is a formula for success that\'s been followed by the icons of history - from John D. Rockefeller to Amelia Earhart to Ulysses S. Grant to Steve Jobs - a formula that let them turn obstacles into opportunities. Faced with impossible situations, they found the astounding triumphs we all seek.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(15, 'Say Nothing', 'Patrick Radden Keefe', 'English', 'Fiction', 'Historical', '', 'Doubleday', '0385521316', 464, , 'In December 1972, Jean McConville, a thirty-eight-year-old mother of ten, was dragged from her Belfast home by masked intruders, her children clinging to her legs. They never saw her again. Her abduction was one of the most notorious episodes of the vicious conflict known as The Troubles. Everyone in the neighborhood knew the I.R.A. was responsible. But in a climate of fear and paranoia, no one would speak of it. In 2003, five years after an accord brought an uneasy peace to Northern Ireland, a set of human bones was discovered on a beach. McConville\'s children knew it was their mother when they were told a blue safety pin was attached to the dress--with so many kids, she had always kept it handy for diapers or ripped clothes.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(16, 'Ten Caesars', 'Barry Strauss', 'English', 'Fiction', 'Historical', '', 'Simon & Schuster', '145166883X', 432, , 'Ten Caesars is a captivating narrative that breathes new life into a host of transformative figures (Publishers Weekly). This superb summation of four centuries of Roman history, a masterpiece of compression, confirms Barry Strauss as the foremost academic classicist writing for the general reader today (The Wall Street Journal).', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(17, 'Wild Game', 'Adrienne Brodeur', 'English', 'Non Fiction', 'Biography', '', 'Houghton Mifflin Harcourt', '1328519031', 256, , 'Wild Game is a brilliant, timeless memoir about how the people close to us can break our hearts simply because they have access to them, and the lies we tell in order to justify the choices we make. Its a remarkable story of resilience, a reminder that we need not be the parents our parents were to us.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(18, 'They Called Us Enemy', 'George Takei', 'English', 'Non Fiction', 'Biography', '', 'Top Shelf Productions', '1603094504', 208, , 'George Takei has captured hearts and minds worldwide with his captivating stage presence and outspoken commitment to equal rights. But long before he braved new frontiers in Star Trek, he woke up as a four-year-old boy to find his own birth country at war with his father\'s -- and their entire family forced from their home into an uncertain future.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(19, 'Maybe You Should Talk to Someone', 'Lori Gottlieb', 'English', 'Non Fiction', 'Biography', '', 'Houghton Mifflin Harcourt', '1328662055', 432, , 'Maybe You Should Talk to Someone is revolutionary in its candor, offering a deeply personal yet universal tour of our hearts and minds and providing the rarest of gifts: a boldly revealing portrait of what it means to be human, and a disarmingly funny and illuminating account of our own mysterious lives and our power to transform them.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(20, 'Save Me the Plums', 'Ruth Reichl', 'English', 'Non Fiction', 'Biography', '', 'Random House', '1400069998', 288, , 'Complete with recipes, Save Me the Plums is a personal journey of a woman coming to terms with being in charge and making a mark, following a passion and holding on to her dreamseven when she ends up in a place she never expected to be.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(21, 'The First Cell', 'Azra Raza', 'English', 'Fiction', 'Science', '', 'Recorded Books', '1400069998', 288, , 'A world-class oncologist\'s devastating and deeply personal examination of cancer.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(22, 'Underland', 'Robert Macfarlane', 'English', 'Fiction', 'Science', '', 'W. W. Norton & Company', '0393242145', 496, , 'Underland marks a new turn in Macfarlanes long-term mapping of the relations of landscape and the human heart. From its remarkable opening pages to its deeply moving conclusion, it is a journey into wonder, loss, fear, and hope. At once ancient and urgent, this is a book that will change the way you see the world.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(23, 'The Lost Words', 'Robert Macfarlane', 'English', 'Fiction', 'Science', '', 'Anansi International', '1487005385', 128, , 'In 2007, when a new edition of the Oxford Junior Dictionary ? widely used in schools around the world ? was published, a sharp-eyed reader soon noticed that around forty common words concerning nature had been dropped. Apparently they were no longer being used enough by children to merit their place in the dictionary.', 5, '2020-02-16 06:51:20', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(24, 'The Truth About Cancer', 'Ty M. Bollinger', 'English', 'Fiction', 'Self-Help', '', 'Hay House', '', 100, , 'One out of three women alive today, and one out of two men, will face a cancer diagnosis, according to the World Health Organization. Ty Bollinger takes this personally: in the course of a decade, he says, \"I lost my entire family to cancer. I don\'t believe I had to lose them.\" The Truth about Cancer has been written for one simple reason: to share the knowledge we need to protect ourselves, treat ourselves, and in some cases save our lives or the lives of those we love.', 0, '2020-02-17 04:53:46', 'user');
INSERT INTO `1book` (`id`, `bookTitle`, `author`, `language`, `category`, `subcategory`, `copyright`, `publisher`, `isbn`, `paperback`, `photo`, `review`, `rank`, `createDate`, `postBy`) VALUES
(25, 'Range', 'David Epstein', 'English', 'Non Fiction', 'Science', '', 'Riverhead Books', '', 100, , 'Plenty of experts argue that anyone who wants to develop a skill, play an instrument, or lead their field should start early, focus intensely, and rack up as many hours of deliberate practice as possible. If you dabble or delay, youll never catch up to the people who got a head start. But a closer look at research on the worlds top performers, from professional athletes to Nobel laureates, shows that early specialization is the exception, not the rule. ', 0, '2020-02-17 05:06:26', 'user');

